import axios from 'axios';

const API_URL = 'http://127.0.0.1:8000/api'; // Adjust URL if necessary

export const fetchUsers = () => axios.get(`${API_URL}/users`);
export const fetchUser = (id) => axios.get(`${API_URL}/users/${id}`);
